import React from 'react';
import 'tachyons/css/tachyons.css';

class Card extends React.Component{
    render(props){
        return(
            <div className="bg-light-green dib br3 pa3 mr3 grow bw-4 shadow-5 tc">
                <img src="https://robohash.org/1?size=200x200"></img>
                <h3>Name: {props.name} </h3>
                <p>email: {props.email} </p>
            </div>
        );
    }
}

export default Card;
